import React, { useState } from "react";
import "./App.css";

function App() {
  const [datafile, setDataFile] = useState([
    { id: "1", home: "ghar", age: "69" },
    { id: "1", home: "ghar", age: "69" }

  ]);
  setDataFile((prevState) => ({
    ...prevState,
    id: "2" ,
    home: "nayaghar",
    age: "71",

   }));

  return (

    <div className="App">
      {datafile.map((datainfo) => {
        return <button onClick = {setDataFile}>{datainfo.id}</button>;
      })}
    </div>



  );
}

export default App;
